headerSass:".custom-header {
.first-tier {
    height: 140px;

  }
  .first-tier .nav {
    background-color: #022a56;
    color: #022a56;
  }

  .first-tier .site-logo img {
    vertical-align: middle;
  }
  .second-tier {
    margin-bottom: 0px;
     background-color: #011b37;
  }

.dropbtn {
    background-color: #011b37;
    color: white;
    padding: 16px;
    font-size: 16px;
    border: none;
    cursor: pointer;

}

.dropdown {
    position: relative;
    display: inline-block;
}

.dropdown-content {
    display: none;
    position: absolute;
    background-color: #011b37;
    min-width: 160px;
    box-shadow: 0px 8px 16px 0px rgba(0

column417:
0.2);
    z-index: 1;
}

.dropdown-content a {
    color: white;
    padding: 12px 16px;
    text-decoration: none;
    display: block;
}

.dropdown-content a:hover {background-color: #778899}

.dropdown:hover .dropdown-content {
    display: block;
}

.dropdown:hover .dropbtn {
    background-color: #778899;

}

}"

